import React from 'react';

const Login = () => {
  return <div className='login-container'>
    <h3>Login</h3>
    <div className='loginForm'>
      <form>
        <input type='text' lable="username"/>
        <input type='text' lable="username"/>
        <button type='sub'>Login</button>
      </form>
    </div>
  </div>;
};

export default Login;
